import React from 'react';

import { Container } from './styles';
import logo from '../../assets/logo.svg';

export default function Header() {
  return (
    <Container>
      <nav>
        <img src={logo} alt="" />
        <text>ENCOMENDAS</text>
        <text>ENTREGADORES</text>
        <text>DESTINATÁRIOS</text>
        <text>PROBLEMAS</text>
      </nav>
      <anside>
        <text>Admim</text>
        <text>sair do sistema</text>
      </anside>
    </Container>
  );
}
